import Button from '@material-ui/core/Button';
import {Switch, Route} from 'react-router-dom'
import AllMembersComp from "./AllMembers";

function MainSubsComp(props){




  const goToAddMovie = () => {
    props.history.push('/main/subs/add-member')
  }

 const showAllMembers =() => 
 {
   props.history.push("/main/subs/all-members")
 }

  return (
    <div className="App">

      <nav>
      <Button onClick={showAllMembers}>All Movies</Button> &nbsp;

        <Button onClick={goToAddMovie}>Add Movie</Button>
      </nav>



  <Switch>
      <Route path="/main/subs/all-members" component={AllMembersComp} /> 
      <Route path="/main/subs/edit-member/:id" component={EditMovieComp} /> 
      <Route path="/main/subs/add-member" component={AddMovieComp} /> 
    </Switch>

    </div>
  );
}

export default MainSubsComp;
